import { Card, Typography } from '@mui/material'
import { Container } from '@mui/system'
import React from 'react'

function IntroducePage() {
  return (
    <Container>
      <Card>
    <Typography 
    sx={{
    fontSize:20,
    textAlign:"center",
    m:5
    }}
     >
      Introduce
    </Typography>
      </Card>
    </Container>
  )
}

export default IntroducePage
